// NavigationBar.js
import React from "react";
import "./styles.css"; // Assurez-vous que le chemin d'accès est correct

const NavigationBar = () => {
  return (
    <div className="navigation">
      <button className="btn btn-films">Films</button>
      <button className="btn btn-series">Séries</button>
      <button className="btn btn-anime">Anime</button>
      <button className="btn btn-qcm">QCM</button>
      <button className="btn btn-evenements">Événements</button>
    </div>
  );
};

export default NavigationBar;
